<p><strong>HPV is very common. It is estimated that up to 80% of people in Australia have HPV at some time in their lives. Many people who have HPV have no idea that they have been exposed to the infection.</strong></p>
<p><strong><!-- /wp:paragraph --><!-- wp:paragraph --></strong></p>
<p><strong>Most HPV infections don't lead to cancer. But some types of genital HPV can cause cancer of the lower part of the uterus that connects to the vagina (cervix). Other types of cancers, including cancers of the anus, penis, vagina, vulva and back of the throat (oropharyngeal), have been linked to HPV infection.</strong></p>
<p><strong><!-- /wp:paragraph --><!-- wp:paragraph --></strong></p>
<p><strong>The new national cervical screening program tests women aged 25 to 74 for the HPV infection every 5 years. The test is looking for the 15 high risk HPV types which could develop into cancer in the future.</strong></p>
