<h2><strong>Causes</strong></h2>
<p><strong><!-- /wp:heading --><!-- wp:paragraph --></strong></p>
<p><strong>If you're pregnant and have an HPV infection with genital warts, it's possible your baby may get the infection. Rarely, the infection may cause a noncancerous growth in the baby's voice box (larynx).Warts are contagious. They can spread through direct contact with a wart. Warts can also spread when someone touches something that already touched a wart.</strong></p>
<p><strong><!-- /wp:paragraph --><!-- wp:heading --></strong></p>
